Septintą kartą vykusios Baltijos taurės varžybos tapo auksinėmis lietuviams. Mūsiškiai anksčiau net penkis kartus liko antrojoje vietoje. Tuo pačiu jie nukarūnavo čempionų titulą gynusius latvius, kurie turnyrą laimėjo daugiausiai kartų. Į finalinę dvikovą abi komandos žengė skirtingose pozicijose – Latvija su trimis taškais buvo grupės lyderė, o lietuviai po lygiųjų su Estija turėjo tašką, tad mūsų šalies komandą tenkino tik pergalė. Susitikimo pradžioje Lietuvai teko atlaikyti svečių spaudimą, o Marių Šalkauską startiniame vienuoliktuke pakeitęs vartininkas Tadas Norbutas kelis kartus atrėmė ambicingus varžovų smūgius. Latvijai nesisekė būti produktyviai, o lietuviai viena pirmųjų galimybių pasinaudojo užtikrintai. Ketvirtą minutę kontratakoje Justinui Zagurskui ties aikštės viduriu patogiai nukrito kamuolys ir futbolininkas pasinaudojo tuo, kad nebuvo niekieno trukdomas bei stipriu smūgiu nuginklavo latvių vartininką. Latvijos rinktinė į tai bandė atsakyti savo atakomis ir dominavo aikštėje, tačiau išpildyti savo sumanymus jai sekėsi prastai, o T. Norbutas toliau saugojo vartus nepriekaištingai. 14-ąją minutę lietuviai buvo arti antrojo įvarčio. Dar vienoje kontratakoje Arsenijus Buinickis perdavimu iš kairiojo krašto surado Albertą Voskunovičių, kuris prašovė šalia dešiniojo virpsto. Paskutinėmis minutėmis latviai surengė tikrą vartų šturmą, o Oskaras Ikstenis galingu smūgiu sudrebino vartų skersinį. Visgi į pertrauką komandos išėjo švieslentėje degant rezultatui 1:0 Lietuvos naudai. Antrojo kėlinio pradžioje Latvijai pavyko išlyginti rezultatą. Standartinėje situacijoje Artūras Jerofejevas sėkmingai kyštelėjo koją prie virpsto ir užtikrintai išpildė komandos draugo ilgą perdavimą. Naujojo trenerio Jevgeno Ryvkino treniruojami lietuviai nesiruošė tenkintis tokiu rezultatu ir 23-iąją minutę sugebėjo susigrąžinti pranašumą – įvykių sūkuryje vėl atsidūręs J. Zagurskas gražioje atakoje tolimu smūgiu įveikė varžovų vartininką. Aikštėje toliau netrūko kietos, kontaktinės kovos, o latviai vėl pataikė į vartų konstrukciją. Visgi 34-ąją minutę Lietuvai pavyko įtvirtinti savo persvarą įspūdingu stiliumi – A. Buinickis techniškai perkėlė kamuolį per varžovų žaidėjus į vartus. Po kelių minučių Latvijai pavyko sušvelninti rezultatą, kai Igoris Avanesovas galingu smūgiu iš krašto pataikė į tolimąjį kampą. Tiesa, kamuolys po smūgio atsimušė nuo jo komandos draugo O. Ikstenio, laukusio galimybės prie virpsto. Lietuva iki paskutinių minučių turėjo atlaikyti varžovų spaudimą, bet kovingai žaidę mūsų futbolininkai iškovojo saldžią ir įsimintiną pergalę, kuri perrašė šalies salės futbolo istoriją Baltijos taurėje. (function(d, s, i, r) {
